import React from 'react';
import {Link} from 'react-router-dom'
import './css/Home.css'

class Home extends React.Component {
  state = {
    checkLogPas: false
  }
  signOut = (field) => event => {
    this.setState({ [field]: false })
    delete localStorage["token"]
  }
  render () {
    return (
      <div className="Home">
        <div className="header">
          <div className="logo">
          </div>
          <div className="homeLink">
            <Link to="/">Главная</Link>
          </div>
          <div>
          </div>
          <div>
          </div>
          <div>
          </div>
          <div>
            <Link to="/auth" checked={this.state.checkLogPas} onClick={this.signOut("checkLogPas")}>Выйти</Link>
          </div>
          <div>
          </div>
        </div>
        <div className="body">
        </div>
      </div>
    )
  }
}

export default Home;
